import React from "react";
import styled from "styled-components";
const Menu = (props) => {
  const Background = styled.div`
    position: absolute;
    background-color: rgba(0, 0, 0, 0.704);
    width: 100%;
    height: 100rem;
  `;
  const Container = styled.div`
    background-color: white;
    position: relative;
    left: 35%;
    width: 65%;
    height: 100%;
  `;
  return (
    <>
      <Background>
        <Container CloseBtn={props.CloseBtn}></Container>
      </Background>
    </>
  );
};

export default Menu;
